import React from 'react';
import { Link } from 'react-router-dom';
import  "/Na"

function Navbar() {
  return (
    <div className='Nav'>
      <img src='/'/>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="">Categories</Link></li>
        <li><Link to="">About</Link></li>
        <li><Link to="">Contact</Link></li>
      </ul>
        
    </div>
  )
}

export default Navbar
